import React from "react";

function ContactCredits() {
    return (
        <>
            <h2 href="#home">Elean</h2>
            <p className="phone font-weight-bold"> <span>ТЕЛ.:</span>050 362-04-05</p>
            <p className="whatsapp font-weight-bold"> <span>WHATSAPP:</span> 050 362-04-05</p>
            <p className="email font-weight-bold"> <span>EMAIL:</span>  info@eleanboutique.ru</p>
        </>
    );
}

export default ContactCredits;
